//data for post

export default class LocalJson extends Component {
	render(data) {
		return (
			<div>
				<Container fluid={true}>
					<Row>
						<CardDeck className=" no-gutters ">
							{data.map((postData) => {
								console.log(postData);
								return (
									<Card key={postData.id}>
										<Card.Img variant="top" src={postData.image} />
										<Card.Body>
											<Card.Title className="tile">
                                            {postData.hits.map((hit) => {
                                                {hit.pageURL}
                                            })}
											</Card.Title>
											<Card.Subtitle className="tag">
												{postData.id + " "}
											</Card.Subtitle>

											<Card.Text className="para">
												{postData.user}
											</Card.Text>
										</Card.Body>
									</Card>
								);
							})}
						</CardDeck>
					</Row>
				</Container>
			</div>
		);
	}
}
